// SPDX-License-Identifier: MIT
pragma solidity >=0.4.21 <0.7.0;

contract DocumentVault {
    struct Document {
        address uploader;
        string title;
        uint256 timestamp;
    }

    mapping(string => Document) private documents; // fileHash => Document
    event DocumentUploaded(string fileHash, address uploader, string title);
    event DocumentUpdated(string fileHash, string newTitle);
    event DocumentDeleted(string fileHash);

    modifier onlyUploader(string memory fileHash) {
        require(msg.sender == documents[fileHash].uploader, "Only the uploader can perform this action.");
        _;
    }

    function uploadDocument(string memory fileHash, string memory title) public {
        require(bytes(fileHash).length > 0, "File hash cannot be empty.");
        require(bytes(title).length > 0, "Title cannot be empty.");
        require(documents[fileHash].uploader == address(0), "Document already exists.");

        documents[fileHash] = Document(msg.sender, title, now);
        emit DocumentUploaded(fileHash, msg.sender, title);
    }

    function getDocumentDetails(string memory fileHash) public view returns (address, string memory, uint256) {
        require(documents[fileHash].uploader != address(0), "Document does not exist.");
        Document memory doc = documents[fileHash];
        return (doc.uploader, doc.title, doc.timestamp);
    }

    function updateDocumentTitle(string memory fileHash, string memory newTitle) public onlyUploader(fileHash) {
        require(bytes(newTitle).length > 0, "New title cannot be empty.");
        documents[fileHash].title = newTitle;
        emit DocumentUpdated(fileHash, newTitle);
    }

    function deleteDocument(string memory fileHash) public onlyUploader(fileHash) {
        require(documents[fileHash].uploader != address(0), "Document does not exist.");
        delete documents[fileHash];
        emit DocumentDeleted(fileHash);
    }
}
